import React from 'react';
import '../style.css'
import {
    BrowserRouter,
    Switch,
    Route,
    Link,
    Redirect,
  } from "react-router-dom";


class OwnedPetsPanel extends React.Component {

    render() {
        return (
            <div>
                <div id="petBox">
                    <img src={require("../images/mode_edit.png")} class="edit" style={{marginInlineStart: '95%'}}/>
                    <div id="perfilPets">
                        {this.props.items}
                    </div>
                </div>
            </div>
        );
    }
}

export default OwnedPetsPanel;
